import React from 'react';
import '../../App.css';
import gitHubImg from '../../assets/images/GitHub-Mark-32px.png'

function Footer() {
    return (
        <div className="footer">
            <p>Designed and Built by Michelle Gleave</p>
            <img src={gitHubImg}/>
        </div>
    )
};

export default Footer;
